column11:
Name of Project: Johnson Project;
Part of Lot 1, North of Highway 30, Smith's Subdivision, Original Town of Ogallala.
Description: TIF funds will be utilized to pave with concrete surfacing, public streets adjacent and near to the project site in the Eastern Redevelopment Area. The developer of the project will renovate an existing 1680 sq ft building into leaseable space and will also construct a new 4320 sq ft building for use as office or leasable space.

